		<p><strong>Årsmøde torsdag den 29 marts 2001 kl 20.00 efter temamødet og middag<br /></strong><br />Ferrosan, Sydmarken 5, 2860 Søborg</p>
<p>Før generalforsamlingen uddeles legater</p>
<p>Dagsorden for generalforsamlingen<br />1. Valg af dirigent <br />2. Formandens beretning for det forløbne år <br />3. Forelæggelse af det reviderede regnskab til godkendelse <br />4. Fastsættelse af kontingent <br />5. Valg af bestyrelse <br />&nbsp;&nbsp;&nbsp; a. Valg af 2 ordinære bestyrelsesmedlemmer. Vibeke Jørgensen og Margrethe Møller er på valg og villige til genvalg.&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ellen Garde fortsætter som observatør og Radegundis Temme foreslås også som observatør. <br />6. Forslag fra medlemmerne <br />7. Forslag om fremtidige møder <br />8. Evt.</p>
<hr />
<p><strong>Tilmelding (kryds af) til årsmødet torsdag den 29. marts 2001:</strong> Læge Vibeke Jørgensen, Hegnsvej 37, 2850 Nærum,<br />tlf.nr.: 4580 0328 Fax: 4580 3428 E-mail: <span style="text-decoration: underline;"><span style="color: #333333;"></span></span><a href="mailto:vibeke.jorgensen@dadlnet.dk">vibeke.jorgensen@dadlnet.dk</a></p>
